import React, { useContext } from "react";
import { useNavigate } from "react-router-dom"; // Import useNavigate
import './Login.css';  
import UserContext from "../context/UserContext";  

function Login() {

    const { changeUser } = useContext(UserContext);
    const navigate = useNavigate();  // Get the navigate function

    const handleLogin = () => {
        changeUser({ email: "test@example.com", name: "Test User" }); 
        console.log("User logged in");
        navigate('/dashboard'); // Redirect to the dashboard after login
    };

    return (
        <div className="login-container">
            <div className="login-left">
                <h1 className="login-title">Masuk</h1>
                <p className="login-subtitle">
                    Daftar dan buat akun untuk temukan layanan sesuai kebutuhan Anda
                </p>
                <div className="login-form">
                    <label htmlFor="email">Email</label>
                    <input id="email" name="email" type="email" placeholder="Masukan Email Anda" className="login-input" />

                    <label htmlFor="password">Kata Sandi</label>
                    <input id="password" name="password" type="password" placeholder="Masukan Kata Sandi Anda" className="login-input" />

                    <button type="button" onClick={handleLogin} className="login-button">Masuk</button>
                </div>
                <p className="login-footer">
                    Belum punya akun? <a href="/register">Daftar</a>
                </p>
            </div>
            <div className="login-right">
                <img src="/path/to/your/image.png" alt="Warehouse worker" className="login-image" />
            </div>
        </div>
    );
}

export default Login;
